import React from 'react';

const Popup = ({openDialog}) => {
    return ( 
        <Dialog openDialog open={openDialog}>
            <DialogTitle>
                <h1>HELLO</h1>
            </DialogTitle>
        </Dialog>
     );
}

export default Popup;
